import './styles.css';
import Avatar from "./biomeavatar.png";


function PostForm() {
    return (
        <div className="bg-biome_dark px-6 py-4 text-gray-400">

        <div className="border border-biome_border p-2 rounded-md flex bg-biome_dark-brighter">
          <div className="rounded-full bg-gray-600 overflow-hidden w-10 h-10">
            <img src = {Avatar} alt="" /> 
          </div>
          <form action="" className="flex-grow bg-biome_dark-brightest border border-biome_border ml-4 rounded-md">
            <input type ="text" className="bg-biome_dark-brightest p-2 px-3 text-sm block w-full rounded-md" placeholder="New Post"/>
          </form>
        </div>
      </div>

    )
}

export default PostForm;
